(3, 'I am having trouble setting/resetting my PIN signature', 20220322, '<p style=\"margin-right: 0px; margin-bottom: 40px; margin-left: 0px; font-size: 14px; line-height: 26px; color: rgb(51, 51, 51);\">Your&nbsp;<span style=\"font-weight: 700;\">Portal PIN</span>&nbsp;signature is a 4 or 5 digit number that is required to submit certain forms on the TWE Employee Portal.</p><p style=\"margin-right: 0px; margin-bottom: 40px; margin-left: 0px; font-size: 14px; line-height: 26px; color: rgb(51, 51, 51);\">If you are having trouble with a PIN reset, please follow these steps:</p><p style=\"margin-right: 0px; margin-bottom: 40px; margin-left: 0px; font-size: 14px; line-height: 26px; color: rgb(51, 51, 51);\"><span style=\"font-weight: initial;\">Login to the&nbsp;</span><a href=\"https://employees.thewirelessexperience.com/\" style=\"background-color: rgb(255, 255, 255); font-weight: initial; color: rgb(22, 108, 148); text-decoration-line: underline;\">TWE Employee Portal</a></p><ol style=\"line-height: 35px; font-size: 14px; color: rgb(51, 51, 51); margin-bottom: 20px; padding: 0px 21px;\"><li><span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">Click the image/headshot in the upper left of the dashboard in order to open your profile editor<br></span><img src=\"data:image/jpeg;base64,\" data-filename=\"PIN-reset-help-2.jpg\" style=\"width: 640px;\"><br><span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"><br></span></li><li>Scroll to the bottom of the profile window to find the section “Change Your PIN Signature”</li><li>Enter your&nbsp;<span style=\"font-weight: 700;\">portal password�</span>in the input field and click “Send Request Email”<br><img src=\"data:image/png;base64,\" data-filename=\"PIN-reset-help.png\" style=\"width: 640px;\"><br><br></li><li>An email will be sent to your email address on file with further instruction to complete the reset PIN process.<br></li></ol><p>If you are still experiencing further issue with resetting your PIN signature, please inform your supervisor for further assistance.<br></p>', '40', 'Publish', 20220322, '2022-11-16 14:53:27', '2022-11-16 14:53:27');
