(4, 'Where can I find my TWE Uniform Coupon Code?', 20220322, '<h1 style=\"margin-right: 0px; margin-bottom: 34px; margin-left: 0px; font-size: 24px; font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\">Where can I find my TWE Uniform Coupon Code?</h1><p style=\"margin-right: 0px; margin-bottom: 40px; margin-left: 0px; font-size: 14px; line-height: 26px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;\"=\"\">You should receive a welcome email via the Employee Portal which contains your TWE Shirt coupon code.� In the event you didn’t receive this e-mail, your coupon code can be located once you have logged into the portal.</p><p style=\"margin-right: 0px; margin-bottom: 40px; margin-left: 0px; font-size: 14px; line-height: 26px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;\"=\"\">Search the portal for “<a href=\"https://employees.thewirelessexperience.com/form.php?form=order_shirts\" style=\"color: rgb(22, 108, 148); text-decoration-line: underline;\">Order Shirts</a>” or in the Tools Menu, navigate to Marketing &gt;&nbsp;<a href=\"https://employees.thewirelessexperience.com/form.php?form=order_shirts\" style=\"color: rgb(22, 108, 148); text-decoration-line: underline;\">Order Shirts.</a></p><p style=\"margin-right: 0px; margin-bottom: 40px; margin-left: 0px; font-size: 14px; line-height: 26px; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;\"=\"\"><span style=\"font-weight: 700;\">You can find your coupon code at the bottom of that page.</span>&nbsp;If the code is not present or blank, please notify your supervisor.</p><div><img src=\"data:image/jpeg;base64,\" data-filename=\"coupon-code.jpg\" style=\"width: 838px;\"><br></div>', '40', 'Publish', 3650, '2022-12-09 18:12:31', '2022-12-23 15:20:44'),
