(1, 100, 0, 'My First News', '<ol><li><strong style=\"margin: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">Lorem Ipsum</strong><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">&nbsp;is simply dummy text of the </span></li><li><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">Printing and typesetting industry. Lorem Ipsum has been.</span></li><li><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">the industry\'s standard dummy text ever since the 1500s.</span></li><li><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">When an unknown printer took a galley of type and scrambled it to make a type specimen book.</span><br></li></ol>', 'news/1668174388.jpg', 'publish', '2022-10-01 13:46:28', '2022-10-01 13:46:28'),
