(3, 20220322, 0, 'Why do we use it?', '<h2>Why do we use it?</h2><hr><p><span style=\"font-size: 1rem; font-weight: initial;\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span><br></p>', 'news/1668445610.png', 'publish', '2022-11-11 14:59:41', '2022-11-14 17:06:50'),
(4, 20220322, 0, 'Why do we use it?', '<h2>Why do we use it?</h2><hr><p><span style=\"font-size: 1rem; font-weight: initial;\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span><br></p>', NULL, 'publish', '2022-11-11 15:00:32', '2022-11-11 15:00:32'),
(5, 20220322, 20220322, 'Team Colors', '<h1><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">If you have any questions about the current Team Colors requirements, please refer to the current Team Colors Guidelines here:&nbsp;</span><a href=\"https://employees.thewirelessexperience.com/knowledgebase/twe-way/kbe_knowledgebase/1207/\" style=\"background-color: rgb(255, 255, 255); color: rgb(51, 122, 183); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">Team Colors Guidelines</a><br></h1>', 'news/1672251478.JPG', 'publish', '2022-11-11 15:40:21', '2022-12-28 18:17:58'),
(6, 20220322, 20220322, 'LEARNit is here!', '<h1><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">LEARNit the next step in our continuation and growth of the TWE and our experience. By launching our new training system in pair with our current TWE Development Method and New Hire Training, we will be able to provide more content, more knowledge, with more flexibility to support our people and business. LEARNit will allow learners to expand knowledge outside of Leader Led trainings or coaching sessions on a time that fit their schedule, store traffic flow, and turn down time into learning opportunity. This system will be built with three intentions: provide our team more knowledge, providing quick and easy to digest content, all with the flexibility to learn within to the needs of the store schedule and traffic flow.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\"><span style=\"font-weight: 700;\"><br></span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\"><u><span style=\"font-weight: 700;\">Launch Expectations</span></u></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">• This system will be integrated throughout the year into our existing training programs</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">• We will launch with system training surrounding our new Clock System</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">• Information to register into system will be sent via email Mon 1/10/2021</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">• Upon receiving the email, profile should be set up and completed</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">• Completion of first training assignment due Thursday 1/13/2021</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">• STLS ONLY ensure all WS are enrolled in the Time Clock Facial Recognition training in store by end of day Wednesday, and have completed initial training by Thursday</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">Using LEARNit/ Best Practices for Learners</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">- Upon logging in all users should review their profile and ensure ATTUID is linked</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">- Home Page- ability to navigate system via the top drop down next to Name and Learner Status and on Right Hand Panel of homepage</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">- Click drop down to review My INFO. This is your profile page to changing password as well as linking your ATTUID to receive credit for completing course</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">- Click drop down and My Courses to review all courses assigned to you, start courses, and seeing completed courses</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">- Click drop down and My Progress to review all training progress and your points/badges earned</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">Expectations/Moving Forward</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">-This program will coincide with PLE reporting and new courses launch announcements and are due upon assignment</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">Completion of courses should be completed in store during downtime</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\">New Course assignments will be auto assigned and become available via on the home page and under “myCourses”</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\"><span style=\"font-weight: 700;\">Completion Reporting sent to DTLs and STLs</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\"><span style=\"font-weight: 700;\">STLs expectation to ensure WS are completing all new PLE and LEARNit assignments weekly/monthly</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\"><span style=\"font-weight: 700;\">STLs expected to assist the registration of all new hires and begin the completion of assigned courses (same as PLE)</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\"><span style=\"font-weight: 700;\">Link to platform:&nbsp;<a href=\"https://tweatt.talentlms.com/dashboard\" style=\"color: rgb(51, 122, 183);\">LEARNit</a></span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\"><span style=\"font-weight: 700;\"><br></span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-weight: 400;\"><span style=\"font-weight: 700;\"><em>If you have any questions or need support with logging into the platform, please reach out to your DTL or to a member of the Talent Team!</em></span></p></h1>', 'news/1672251060.jpg', 'publish', '2022-11-11 16:11:25', '2022-12-28 18:11:00');
