(7, 20220322, 20220322, 'When to put in an I.T. Ticket vs a Maintenance Request', '<p>We have noticed a lot of maintenance requests being put in through the I.T. Ticket Panel. To help you understand which ticket should go where, please refer to the attached graphic!</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"1643225517-0.jpg\" style=\"width: 1621.39px;\"><br></p>', 'news/1672250984.jpg', 'publish', '2022-11-14 17:08:46', '2022-12-28 18:09:44');
INSERT INTO `news` (`id`, `author`, `updated_by`, `title`, `content`, `media`, `status`, `created`, `updated`) VALUES
(8, 3650, 20220322, 'Open Enrollment 2023', '<div>This year the Open Enrollment is going to be a “passive enrollment,” which means that if you already have a plan and wish to keep the exact same plan and dependents, no action is required. If you would like to make any changes to your coverage, dependents or continue your FSA, action is required.</div><div><br></div><div>????????If you have an FSA and do not enroll during open enrollment, your FSA will end Dec 31st, 2022.????????</div><div><br></div><div>Details regarding the plan options for 2023 have been released today via email as well as posted to the portal and workplace.</div><div><br></div><div>Open Enrollment 2021 is a digital enrollment through ADP Workforce Now. When you log into your ADP Workforce Now account, there will be a pop-up prompting you to enroll or waive coverage for open enrollment. This process will begin on Friday Dec 9th and continue through Friday December 16th.</div><div><br></div><div>If you have any questions, please reach out to someone from out HR team via AskHR and select the Open Enrollment topic.</div><div><br></div><div>Enroll here: https://workforcenow.adp.com/public/index.htm</div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div>-TWE Human Resources Team</div>', 'news/1672250863.JPG', 'publish', '2022-12-21 18:47:31', '2022-12-28 18:07:43'),
