(2, 20220322, 'Lorem Ipsum is simply', '<a href=\"#\">Lorem Ipsum</a> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.', 20220322, 'Limited', '1668038400', '1672358400', 'Publish', '2022-11-16 18:31:11', '2022-12-19 13:30:26'),
(3, 20220322, 'Urgent Test Message', '<p><font face=\"Tahoma\"><strong style=\"margin: 0px; padding: 0px; font-size: 14px; text-align: justify;\">Lorem Ipsum</strong><span style=\"font-size: 14px; text-align: justify;\"> is simply dummy text of the printing and typesetting industry.</span></font></p><p><span style=\"font-size: 14px; text-align: justify; font-weight: initial;\"><font face=\"Tahoma\">Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.</font></span></p><p><span style=\"font-size: 14px; font-weight: initial; text-align: justify;\"><font face=\"Tahoma\">It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</font></span><br></p>', 20220322, 'Limited', '1672272000', '1675123200', 'Publish', '2022-11-16 19:06:57', '2022-12-29 18:08:16');
